package com.act.activiti.entity;import lombok.Data;import java.util.Date;/** * @author pen */@Datapublic class ActRequest {	/**	 * 请求编号	 */	private Integer requestId;	/**	 * 请求类型	 */	private String requestType;	/**	 * 请求地址	 */	private String requestUrl;	/**	 * 请求参数	 */	private String requestaram;	/**	 * 添加人	 */	private String addName;	/**	 * 添加时间	 */	private Date addTime;		/**	 * 修改时间时间	 */	private Date upTime;	/**	 * 备注字段	 */	private String remark;	/**	 * 添加名称	 */	private String reqName;	/**	 * 任务key	 */	private String keyName;	/**	 * 请求循序	 */	private Integer getOrder;	private String auditFlagNo;	public ActRequest() {	}		public ActRequest(String keyName) {		this.keyName = keyName;	}		public ActRequest(String keyName, Integer getOrder) {		this.keyName = keyName;		this.getOrder = getOrder;	}		public ActRequest(Integer requestId, String requestType, String requestUrl, String requestaram, String addName, Date addTime, Date upTime, String remark, String reqName, String keyName, Integer getOrder) {		this.requestId = requestId;		this.requestType = requestType;		this.requestUrl = requestUrl;		this.requestaram = requestaram;		this.addName = addName;		this.addTime = addTime;		this.upTime = upTime;		this.remark = remark;		this.reqName = reqName;		this.keyName = keyName;		this.getOrder = getOrder;	}}